import React from 'react'
import TodoListItem from './TodoListItem'
import '../styles/TodoList.scss'

export default function TodoList({todos, onRemove, onToggle}) {
  
  return (
    <div className='TodoList'>
      {todos.map((todo)=>(
        <TodoListItem 
            todo={todo}
            key={todo.id}
            onRemove={onRemove}
            
        />
      ))}
      
    </div>
  )
}
